// @flow strict

const Navigation = ({ pokemon }) => {
	return (
		<React.Fragment>
			{!!pokemon.next && <button onClick={() => setQuery(pokemon.next)}>Next</button>}
			{!!pokemon.previous && <button onClick={() => setQuery(pokemon.previous)}>Previous</button>}
		</React.Fragment>
	)
}

export { Navigation };
